import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";
export default function Main() {


  const [name, setname] = useState("");
  const [result, setresult] = useState([]);

  useEffect(async () => {
    await axios
      .get(
        " https://api.unsplash.com/photos/?client_id=nOjAEY5Od5zh0fLWjNVtyWern1Sjj_lUpvb6Oi_F1cg"
      )
      .then((response) => setresult(response.data));
  }, []);

  useEffect(async () => {
    await axios
      .get(
        `https://api.unsplash.com/photos/?client_id=nOjAEY5Od5zh0fLWjNVtyWern1Sjj_lUpvb6Oi_F1cg&quary=${name}`
      )
      .then((response) => console.log(response.data));
  }, []);


  const nameHandler = (event) => {
    setname(event.target.value);
  };

  
  const submitHandler = (event) => {
    event.preventDefault();
    console.log("jiii");
    setname("");
  };
  // let test=[1,2,3,4]
  return (
    <div>
      <h1>Image-Finder</h1>
      <input
        type="text"
        placeholder="Search"
        value={name}
        onChange={nameHandler}
      />
      <button onClick={submitHandler}>Search</button>

      {result.map((img, index) => (
        <img src={img.urls.small} key={index} />
      ))}
    </div>
  );
}
